import logo from './logo.svg';
import './App.css';

import rina from './rina.png';
import Header from './header'

function App() {
  return (
    <div className="App w-screen h-screen bg-top-bg bg-cover bg-no-repeat sm:bg-center ">
      <Header></Header>
      <div className="top flex items-center">

        <div className="top-right w-1/2">
          <img src={rina} alt="" srcset="" />
        </div>
      </div>
      <div className="middle flex bg-indigo-200 w-screen h-screen">
        <p></p>
      </div>

    </div>
  );
}

export default App;
